import React from 'react';
import { Link } from 'react-router-dom';

const LandingPage = () => {
  return (
    <div className="min-h-screen relative overflow-hidden">
      {/* Background Image */}
      <div 
        className="absolute inset-0 bg-cover bg-center bg-no-repeat"
        style={{
          backgroundImage: 'url("/landing-background.png")',
        }}
      ></div>

      {/* Header */}
      <header className="relative z-10 flex justify-between items-center p-6">
        {/* Logo */}
        <div className="flex items-center">
          <div className="w-8 h-8 bg-gray-700 rounded mr-3"></div>
          <h1 className="text-xl font-bold text-gray-800">CRESTVIEW EIGHTY</h1>
        </div>

        {/* Navigation */}
        <nav className="flex gap-6">
          <Link 
            to="/map" 
            className="text-gray-700 hover:text-gray-900 font-medium text-sm uppercase tracking-wide transition-colors"
          >
            map
          </Link>
          <Link 
            to="/contact" 
            className="text-gray-700 hover:text-gray-900 font-medium text-sm uppercase tracking-wide transition-colors"
          >
            contact
          </Link>
          <Link 
            to="/portal" 
            className="text-gray-700 hover:text-gray-900 font-medium text-sm uppercase tracking-wide transition-colors"
          >
            login
          </Link>
        </nav>
      </header>

      {/* Main Content */}
      <div className="relative z-10 flex flex-col items-center justify-center min-h-screen -mt-16">
        {/* Central Login Button */}
        <Link 
          to="/portal" 
          className="bg-red-600 hover:bg-red-700 text-white font-bold py-4 px-12 rounded transition-colors text-lg shadow-lg"
        >
          Login
        </Link>
      </div>
    </div>
  );
};

export default LandingPage;
